import "../Css/Main.css"

import MainBanner1 from "./MainBanner1";
import MainBanner2 from "./MainBanner2";
import MainBanner3 from "./MainBanner3";
import MainBanner4 from "./MainBanner4";

const Main = () =>{
    return(
        <>
        <div className="contain">
            <div className="banner banner-1">
                <MainBanner1/>
            </div>
            <div className="banner-2">
               <MainBanner2/>
            </div>
            <div className="banner-3">
                <MainBanner3/>
            </div>
            <div className="banner-4">
                <MainBanner4/>
            </div>
            <div className="banner-5">
                <MainBanner4/>
            </div>
        </div>
        </>
    )
};
export default Main;
